import React, {useContext} from 'react'
import Avatar from '@mui/material/Avatar';
import "./header.css";
import { LoginContext } from './ContextProvider/Context'

const Header = () => {

  const {logindata, serLoginDate} =  useContext(LoginContext);
  //console.log(logindata);

  return (
    <>
        <header>
            <nav>
                <h1>Personal Trainer Web</h1>
                <div className='avatar'>
                  {
                    logindata.VaildUserOne ? <Avatar style={{background: "blue"}}>{logindata.VaildUserOne.fname[0].toUpperCase()}</Avatar>:
                    <Avatar style={{background: "pink"}}>N</Avatar>
                  }
                </div>
            </nav>
        </header>
    </>
  )
}

export default Header
